INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068549874729, 'SSS Class', , 'I want an S-Rank skill too! I want it so badly, I could die for it!(You have awakened an S-Rank skill) (But it only works when you die.)Eh !? WHAT IS THE POINT OF GETTING ONE IF I DIE !?', 'The Greatest Envy\r\n\r\nBreaking news!\r\n\r\nThe Black Dragon Guild attempts to conquer the 40th floor of the Tower. Didn’t they confidently declare that they were going to finally show the might of the greatest guild? Unfortunately, they have returned empty-handed.\r\n\r\nThe Rank 1 Hunter! The Flame Emperor (炎帝) has single-handedly subjugated a Boss once again!\r\n\r\nI envied him.\r\n\r\nWhile blankly staring at the TV, I thought to myself: ‘I envy him. I envy him so much—it’s driving me crazy.’\r\n\r\nHello Flame Emperor-nim!\r\n\r\nAh, right. Hello…\r\n\r\nThe Flame Emperor furrowed his eyebrows. For some reason, even his scrunched brows looked handsome.\r\n\r\nYou have set a new record once again! You are the only person who can single-handedly subjugate a boss monster. May I ask you to share your impressions?\r\n\r\nFirst of all, I would like you to change that shitty title.\r\n\r\nExcuse me?\r\n\r\nI’m talking about the Flame Emperor. Call me by my name instead of using that shitty title. Like, what is the Flame Emperor supposed to mean? It’s embarrassing. I would rather be called the Plague than the Flame Emperor. [1] Someday, I’ll definitely find the bastard who gave me this title and beat the living shit out of him.\r\n\r\nU-Uhhh.\r\n\r\nThe surprised reporter stuttered. He could only stammer, unable to respond. Because the formidable man in front of him was widely known as the protagonist of this era. The subject of countless legends being written.\r\n\r\nIn comparison, I was just an extra who couldn’t even take on a minor role.\r\n\r\n\r\n\r\n \r\n\r\n“Aaah,” I mumbled. “I really envy him.” How nice would it be to live a life like him? A life where you can say anything in front of a camera. I touched my smartphone and entered a random Internet community bulletin board for Hunters. I wanted to see how others reacted to the interview.', 'Shin Noah', 'psikiologi, action, horor', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068551143972, 'Second Life Ranker', , 'Yeon-woo had a twin brother who disappeared five years ago. One day, a pocket watch left by his brother returned to his possession. Inside, he found a hidden diary in which was recorded “By the time you hear this, I guess I will be already dead….” Obelisk, the Tower of the Sun God, a world where several universes and dimensions intersect. In this world, his brother had fallen victim to betrayal while climbing up the tower. After learning the truth, Yeon-woo decided to climb the tower along with his brother’s diary. “From now on, I am Cha Jeong-woo.”', 'Chapter 1 - An Invitation from a Pocket Watch (1)\r\nMarch 21st, 2018 \r\n\r\nYeon-woo adjusted his clothes as he walked across the Incheon airport terminal. His head was shaved, and a Korean flag shone brightly on the arm of his neat military uniform, clearly indicating his status. After he took a moment to organize his backpack, he made a phone call.\r\n\r\nClick.\r\n\r\n“Sergeant Cha reporting in from Korea.”\r\n\r\n“Understood. Take it easy, and try to comfort your parents while you are there.”\r\n\r\n“Thank you.” After expressing his gratitude, Yeon-woo ended the call and put his phone down. He was feeling a lot warmer and more peaceful in Korea after a three-year stay in Africa even though his mind was full of distress. With a cigarette in his mouth, he took something out from his pocket. It was a letter he had received during his mission, and it was marked with the word “obituary”. His younger brother had disappeared five years ago, and the letter had notified him of his brother’s death.\r\n\r\n*  *  *\r\n\r\nThe funeral was finished, and his brother’s ashes had been scattered in the sea in front of Taejongdae, his brother’s favorite place. Yeon-woo hadn’t heard any news about him in the last five years, and now, his brother had shown up inside a cold urn.\r\n\r\n“He was holding this when I found him.” The person who had discovered his brother’s body took out a small box. Yeon-woo opened it with care. It contained two items: a faded photograph and…‘A pocket watch?’\r\n\r\nIn the photograph, his brother stood in front of a shabby house wearing some kind of medieval armor. Next to him were people with unusual appearances. ‘Had he been filming a movie somewhere?’ he wondered. Yeon-woo had roamed around all sorts of places, but he had never seen anything like this.\r\n\r\n“Uhm…”\r\n\r\n“Oh, I’m sorry.” Yeon-woo had been unconsciously touching his brother’s image in the photograph, and the man’s voice brought him back to his senses. A question popped into his mind, but it didn’t seem like an appropriate place to ask, so Yeon-woo could only thank the man and return home.\r\n\r\n*  *  *\r\n\r\nIn his room, he quietly looked at his brother’s smiling face in the photograph. They were twins with identical features and yet they were so different from each other. \r\n\r\nHis brother had been a model student, but he had been weak and introverted. He enjoyed reading books and watching movies. Yeon-woo, on the other hand, was very extroverted. He was also very fit, majoring in athletics before entering the military academy.\r\n\r\nPeople were often surprised by how different they were, but the brothers had always stuck together. The little brother would hold onto his scatterbrained brother and teach him how to study. As his little brother lay in bed, the older brother would tell him several times a day about the fun and exciting things outside. They were both devoted to each other.\r\n\r\nBut then, with only one day before the CSAT, his younger brother had disappeared. So many things changed from that day onwards. His mother, who was already suffering from a chronic illness, passed away. After unsuccessfully searching for his brother for over two years, Yeon-woo gave up and enlisted in the military as a non-commissioned officer, volunteering to be dispatched to Africa.\r\n\r\nFrom that moment on, he became less of an extrovert and grew more cynical. His connection to Korea was cut off, and he’d believed that he would never return. But five years later, the notification of his brother’s death reached him. At first, he had been mad at his brother for disappearing without a word only to end up dead. The first thing that had come to his mind was how self-centered his brother had been. But as the funeral began, he started to feel empty, as if his soul were being torn apart. By the time he was scattering his brother’s ashes in Taejongdae, his heart was bursting at the seams.\r\n\r\nHe wanted to ask what happened to his brother, what he had been doing, and why he had to return in this manner. But his brother in the photograph did not say a word, just as he hadn’t said anything in the last five years.\r\n\r\n“Ah…” Yeon-woo put the photograph down and examined the pocket watch. It was worn out and threadbare, as if it were more than a hundred years old. It no longer ran, and only the Roman numeral for twelve, XII, and the hour hand remained. He took it to a jeweler to have it repaired, but the only answer he got was that it was too rusty to fix.\r\n\r\n“I gave this to my brother as a present.” When they turned nineteen, the year they entered junior year in high school, the brothers had given each other a present on their birthday. The younger brother gave him a book to study, and Yeon-woo gave his brother a pocket watch to wish him luck on his CSAT. This was the pocket watch.\r\n\r\nYeon-woo grabbed the pocket watch, it slipped and fit perfectly in his palm. It was just the right size. “I knew it.” He remembered how he wandered around all the shops, looking for a pocket watch that would perfectly fit in one hand. Yeon-woo turned the watch over. There was a name engraved in cursive in one corner on the back: J. W. Cah.\r\n\r\n“Whoa! I really needed a watch. Thanks, bro. This is way cooler than a digital watch.”\r\n\r\n“Hahaha! What do you think? Your big brother’s got good taste.”\r\n\r\n“But what’s engraved here? J. W. are the initials of my first name, but what is ‘Cah’?”\r\n\r\n“Hmm? That’s Cha, our family name.”\r\n\r\n“How is this ‘Cha’? Look, it’s spelled C-A-H!”\r\n\r\n“What? Dammit! Give it to me.”\r\n\r\n“Why?”\r\n\r\n“I’m gonna bring it back to the shop to have it fixed.”\r\n\r\n“It’s OK, don’t bother. I’ll take it. From now on, I’ll just write C-A-H whenever I write my name.” The younger brother confidently put the watch into his pocket. Later, he proudly wrote “Cah” as his surname on his passport application. At that time, Yeon-woo had felt both sorry and grateful at the same time, but now, he chuckled as he remembered it. As he ran his hand over the pocket watch, he pressed on a knob by accident.\r\n\r\nClick. “Huh?” \r\n\r\n‘Isn’t it already broken?’ he thought. The knob slid into the watch, and suddenly: tik tok. The stopped hour hand began to move.\r\n\r\n“To my older brother, who will listen to this sometime in the future.” He heard a familiar voice inside his head. Yeon-woo instinctively sprang to his feet. It was a voice he hadn’t heard in five years, a voice he thought he would never hear again—his brother’s voice. \r\n\r\nThump, thump! His heart started to pound crazily.\r\n\r\n“By the time you hear this, I guess I will already be dead.” He was not hallucinating. Yeon-woo checked to see if there was a speaker inside the pocket watch but found nothing. The voice was really inside his head. ‘How is this possible?’ he thought.\r\n\r\n“I am sorry. You all had a hard time because of me, didn’t you? I just wanted to find a medicine for Mom. I thought I could return home soon, but time went by too quickly.”\r\n\r\n“What?” It was at this moment that his eyes grew strained. Whoosh! Suddenly, a flood of his brother’s memories passed in front of his eyes like a panorama.\r\n\r\nIt was a diary.\r\n\r\n*  *  *\r\n\r\nOct 9th, 2013\r\n\r\nA strange text message appeared on my phone. It said it would grant anything I wish. No other words, just buttons so I could choose whether to join or not. Normally, I would have ignored the message, but I couldn’t help thinking about Mom in the hospital looking more and more haggard every day. So I pressed the “yes” button, just in case my mom could be cured.\r\n\r\nNothing changed. I felt very hollow. It turned out to only be a prank. But from that day on, I began to have strange dreams of climbing what seemed to be an infinitely tall tower with ninety-nine floors.\r\n\r\nOct 12th, 2013\r\n\r\nIt was definitely not a dream! Everything was clear. It was real.\r\n\r\nA world with creatures like elves and dwarves, but also monsters like orcs, trolls, and dragons. A world where several universes and dimensions intersect in one place. The tower sits in the center, waiting for people from all over the world to climb it. As soon as a person breaks through the ninety-ninth floor, he or she will become a god—at least, that’s what I heard someone say.\r\n\r\nPeople pointed at the tower and called it the Tower of the Sun God. Obelisk. But that doesn’t mean a thing to me. The only thing that matters is that somewhere in this tower is an elixir that can cure all diseases, the Panacea. With that in my hand, I can save Mom from her illness.\r\n\r\nOct 28th, 2013\r\n\r\nI was able to team up with some like-minded friends to start climbing the Tower. Still, it wasn’t easy at all. We had to kill all sorts of monsters, and we faced mortal dangers. This place may look like a game, but it’s not. It’s real. If you die, everything is over. But my teammates and I are talented. Back in the real world, my feeble body always caused worries for my family, but in this world, I was able to see the light through runes.\r\n\r\nWe were told that we were the first team to break through the first ten floors in four days. Since then, I began to seriously consider: I won’t be able to live in the real world and in the Tower at the same time.\r\n\r\nNov 9th, 2013\r\n\r\nI’ve made up my mind. I tried explaining this place to my brother, but whenever I face him, the words won’t come out of my mouth. Do I say: “There’s a world called the Tower, and I’m trying to find some medicine there?\"\r\n\r\nEven though he looks gruff, my brother has a warm heart. What would he say? I bet he would volunteer to take my place instead. That cannot happen. In the end, I decided to leave home. They will be looking for me, but I’ll be gone for half a year. I’m sure I can retrieve the elixir by that time. \r\n\r\nAnd just like that, I disconnected myself from the real world.\r\n\r\nDec 1st, 2013\r\n\r\nMy teammates and I named our team “Arthia”. Arthia is the best in every single way—in teamwork and in individual skills. We are at the top of our game.\r\n\r\nWe rapidly broke through several floors, and there is no one in the Tower who doesn’t know our name. I might be able to get a hold of the Panacea much faster than I thought.\r\n\r\n······\r\n\r\nSep 7th, 2014\r\n\r\nOur climbing speed has slowed. I thought I would need only half a year, but now I might be here for one more year.\r\n\r\nNov 11th, 2014\r\n\r\nWe had a fight with some high-ranking clans who see us as an eyesore. We now have more obstacles to overcome.\r\n\r\n······\r\n\r\nFeb 31st, 2015 \r\n\r\nNegotiations have broken down.\r\n\r\nWar has begun.\r\n\r\n······\r\n\r\nJul 2nd, 2015\r\n\r\nThe alliance of clans we’re fighting has just collapsed. Arthia, which started with only twelve people, is now one of the ten largest clans. All of our teammates are high rankers. And I, Arthia’s leader, have risen to ninth place. It is said that I’m the person who’s entered the top ten in the shortest amount of time. However, I can’t just stand here and celebrate. Because of the war, we haven’t had time to find the elixir. We need to pick up our speed and climb the Tower.\r\n\r\n······\r\n\r\nMar 4th, 2016\r\n\r\nI’ve fallen in love.\r\n\r\n······\r\n\r\nSep 19th, 2016\r\n\r\nAnother war has begun. There’s a fresh enmity between Arthia, which wants to climb higher, and other high-ranking clans, who want to maintain the status quo. I’ve been trying my best to persuade them, but it isn’t easy.\r\n\r\nTo make matters worse, some of our teammates agree with them, but they can’t voice out their opinions because they are worried. Even though I know this, I pushed our clan to continue climbing up the Tower so we couldn’t avoid conflicts.\r\n\r\nBut even now, time keeps flowing. I feel like I’m going crazy.\r\n\r\n······\r\n\r\nJan 2nd, 2017\r\n\r\nArthia is now in fifth place. However, the war hasn’t ended, and everyone is too tired.\r\n\r\n······\r\n\r\nJun 6th, 2017\r\n\r\nWe found a traitor in our clan. We managed to kill him before he could rise up against us, but it was enough to cause a rift within the team. Everyone has started to distrust each other. Members are leaving the clan one by one.\r\n\r\nJul 1st, 2017\r\n\r\nMy body feels heavier.\r\n\r\nI have been poisoned.\r\n\r\nOct 30th, 2017\r\n\r\nHalf of the clan is gone. We keep on losing battles, and now we don’t dare climb to higher floors. I tried asking around about the elixir, but I couldn’t find any information about it.\r\n\r\nAnd my body is slowly breaking down.\r\n\r\nNov 1st, 2017\r\n\r\nThe person I loved left me with a dagger to the heart.\r\n\r\nI barely blocked it with my skill, but I could not continue suppressing the poison. My body is starting to rot.\r\n\r\nDec 30th, 2017\r\n\r\nI miss my brother.\r\n\r\n······\r\n\r\nFeb 1st, 2018\r\n\r\nI am the only one left in Arthia. How did things go so wrong? Is it because I trusted people too much? Or is it because I was too absorbed in my own needs and neglected to look after my teammates?\r\n\r\nOr…is it because I left my family?\r\n\r\nFeb 28th, 2018\r\n\r\nOn the last day of February, I finally got my hands on the elixir. Now, I need to find a way to send it home, but there’s no way. I can’t leave the Tower even if I wanted to, I’m surrounded by other people.\r\n\r\nMaybe they think I will treat my poison with it if I leave. Everyone is coming to kill me. There is no one left by my side. Now I know. There is only one person I can trust.\r\n\r\nBut I cannot show them my weakness.\r\n\r\n*  *  *\r\n\r\nThis is the end of my diary. I believe that if I leave this behind, my brother will find a way to come to this place. If it\'s you, hyung, you can retrieve the elixir and bring it safely to our mom.', 'Sadoyeon', 'psikiologi, action, comedy', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068551264504, 'The Classes That Tiaraised', , 'He was a F-rank Hunter. To top it off, he was an useless F-rank loser of a Hyung, who dragged down his incredible Dongsaeng. While he carelessly lived out his messed up life, he ultimately ended up taking his younger brother’s life. He regressed back in time with his title, Perfect Upbringer. “Okay this time, let’s lay low and take care of the talented ones instead.” He thought. But those S-ranks are acting a little strange.', 'Ch 1: Regression (1)\r\n\r\n<Regression (1)>\r\n \r\n\r\n“… Hyung, are you okay?”\r\n\r\n \r\n\r\nThat guy said. His side was ripped open and his guts were spilling out, and he was asking if I was ok.\r\n\r\nHe was on the verge of death yet his face was only a little pale. His calm look annoyed me. I sat on the floor and looked up at my brother without saying anything.\r\n\r\n \r\n\r\nHe was always interfering with my work. He was better than the dirty me, so people had always told me to stay put and behave, to not hold onto his thigh. They weren’t wrong to say that because eventually I had broken this big and reliable thigh.\r\n\r\nHowever.\r\n\r\n \r\n\r\n“……Why are you here?”\r\n\r\n \r\n\r\nA blunt voice came out of my mouth on this old subject.\r\n\r\nWhy did you come to such a shit place for someone you don’t even know?\r\n\r\n \r\n\r\nWe were anything but close. If we ever ran into each other, there would only be a cold breeze. When my leg bones had been shattered, he did not come to the hospital to see me even once. When I went to him to request for help to fix my broken leg, he coldly turned me down and had me dragged out. That day, after being kicked out I was forced to take the money he gave me. I have never talked to him ever since.\r\n\r\nHe laughed bitterly at my question.\r\n\r\n \r\n\r\n“Why are you here, fuck.”\r\n\r\n \r\n\r\nEven though I thought he was the type of person who would bite the hand that feeds, a curse still emerged from my mouth. He had a lot of expectations on his shoulders but he still gave his life to save a useless family member. Crazy son of a bitch.\r\n\r\nSince when were we that friendly? If you’re dead and on the news, damn it, I’ll just swear a few times and then forget about it. \r\n\r\n \r\n\r\nBut what did you do?\r\n\r\nI was angry. I was angry and irritated by my patheticness, not him.\r\n\r\nYes, I’ve always been an ugly older brother. Even in this situation, I’m still a person with a garbage brain filled with complaints and an inferiority complex.\r\n\r\nSo just let me die in a corner of a Dungeon! Why did you come?!\r\n\r\n \r\n\r\n“Listen to me, hyung.”\r\n\r\n \r\n\r\nThat guy said, avoiding my question.\r\n\r\n \r\n\r\n“Lauchitas falls asleep within five-hour cycles. If you hide for an hour, it will eventually go to sleep. Then you just have to get out through the entrance. I’ve taken care of all the lesser monsters so as long as you do not touch Lauchitas, you will be safe.”\r\n\r\n \r\n\r\nHe then held out a small blue stone to me. It was a gatestone that provided a way out of a closed dungeon. It can only be used near the entrance and is a very valuable item that could only be used one time by one person. \r\n\r\nI did not take the gatestone and pretended to be uncaring.\r\n\r\n \r\n\r\n“Good for you. Now use it.”\r\n\r\n \r\n\r\nHe laughed at my words.\r\n\r\n \r\n\r\n“I’ve got mine. I won’t use this.”\r\n\r\n \r\n\r\n…Now that you’re one of the best Hunters in Korea, you’re carrying several of those precious gatestones. I reluctantly accepted the gatestone.\r\n\r\nIt was only then that he took his eyes off me and looked at his wounds. Without the strength of his skills, he would have long collapsed and died.\r\n\r\n \r\n\r\n“……You have gatestones, do you have anything like elixirs?”\r\n\r\n“No, I don’t. I have a small potion, but I don’t think that’s going to work. Lauchitas has a powerful curse on its claws.”\r\n\r\n \r\n\r\nHe laughed again. I didn’t know how to laugh with him. \r\n\r\nBut that kind of calmness soon reached its limit. His knees bent and his body fell forward. I reflexively caught the upper half of his body. \r\n\r\n \r\n\r\nThe smell of blood that I hadn’t felt so far stung my nose. It was awful. \r\n\r\nI thought I got used to the smell of blood as I walked around the dungeon but it brought me to my knees. I felt sick. \r\n\r\nI was tempted to throw away the body in my arms and flee.\r\n\r\n \r\n\r\n“……hey.”\r\n\r\n \r\n\r\nI could hardly hear the sound of breathing. \r\n\r\nThere was no answer. \r\n\r\nI couldn’t laugh.\r\n\r\n \r\n\r\n“……are you dead?”\r\n\r\n \r\n\r\nMy voice was shaking. It’s none of my business whether this asshole dies or not.\r\n\r\n \r\n\r\n“Han Yuhyun. Are you dead?”\r\n\r\n \r\n\r\nDamn, this stupid son of a bitch. I’d be damned if I survived by myself. I’m sure that there were a lot of guys who would want to burn the scumbag who killed his younger brother.\r\n\r\n \r\n\r\n“You’re going to screw with me to the end?”\r\n\r\n \r\n\r\nI muttered in vain.\r\n\r\nUp to this day, he’s been interrupting me in everything I do. It is now time to hide. Dirty to the end, really.\r\n\r\n \r\n\r\n[Effect of ‘Caregiver’ title has been activated.\r\n\r\nCaregiver’s Additional Skill — Final Reward\r\n\r\nThe skills and abilities of Awakened ‘Han Yuhyun’ have been transferred with twice the efficiency.\r\n\r\nDuration — 01:00]\r\n\r\n \r\n\r\nA notice popped up, confirming his death. As one of the Additional Skills of my title, when a target who had been given the growth buff died, the target’s skills and abilities can be transferred for one hour\r\n\r\nIt also doubled in power.\r\n\r\nAs his power filled my body, some of his memories were also passed on.\r\n\r\n \r\n\r\n‘My brother is an F-Level Awakener.”\r\n\r\n \r\n\r\nThis son of a bitch even to the end—\r\n\r\n \r\n\r\n‘So he cannot be involved with me.’\r\n\r\n \r\n\r\nYuhyun was talking to someone. He seemed a little sad.\r\n\r\n \r\n\r\n‘It’s already damaged, but in the future we need to be even more distant. Because Awakeners who qualified to become Hunters are not protected by the law.’\r\n\r\n‘If my brother becomes my weakness, they will no doubt go after him.’\r\n\r\n \r\n\r\n…who the hell are they?\r\n\r\n \r\n\r\n‘Damn it, dispose of all of those bastards!’\r\n\r\n \r\n\r\nIt was when my leg had been broken. He was angry. And then he was sad again.\r\n\r\n \r\n\r\n‘No. Tell him… healing is not possible. It would be better for him. I kicked him out… But he’s still my brother, I cannot help but help him……’\r\n\r\n‘Hyung, I’m sorry.’\r\n\r\n‘Sorry…’\r\n\r\n‘Please don’t go into the dungeon.’\r\n\r\n‘Hyung.’\r\n\r\n \r\n\r\nMy brother’s memory tightened my throat. The entire area was silent, but the sound of “hyung” still hurt my ears. The body was cold and stiff.\r\n\r\nI was going crazy.\r\n\r\nAs expected, this fellow had covered for me until the very end. What are you protecting me for? The older brother is me. I had lost my parents at an early age, dropped out of school, and took care of my younger brother, raising him.\r\n\r\n \r\n\r\n“Damn him! Did he think I was going to regret this?”\r\n\r\n \r\n\r\nIt’s your fault that you didn’t say a word.\r\n\r\nI carefully laid my younger brother’s body onto the floor. His face looked relaxed. If I leave alone, it would be the same as when I came in.\r\n\r\n \r\n\r\n“I’m not going to cry.”\r\n\r\n \r\n\r\nUntil the end, that selfish guy just did whatever he wanted; why would I cry for him? It was a waste of tears.\r\n\r\nI got up. When I looked at the status window, I saw the increased number of skills. They were all top quality, even the double buffs.\r\n\r\nLaughter broke out. \r\n\r\n \r\n\r\nJust one hour. For just an hour, I had become the strongest person in the world at the cost of my younger brother’s life.\r\n\r\n \r\n\r\n“Damn it, what can you do with only one hour?”\r\n\r\n \r\n\r\nIt would be better for Han Yuhyun to be live longer for 40 or 50 more years. Even if Yuhyun became a grandfather, he would still be a lot stronger than me. How could it be compared to this one-time, one-hour presentation?\r\n\r\n \r\n\r\n“Stupid bastard. That stupid fucking bastard.”\r\n\r\n \r\n\r\nMy brother’s stupidity brought tears to my eyes. The title of ‘genius’ was a waste on him. He was the world’s biggest fool.\r\n\r\n \r\n\r\n“Gigant Shield.”\r\n\r\n \r\n\r\nAs soon as I used the skill, a faint golden light wrapped around my body. Originally, it was a shield that couldn’t stop Lauchitas’ claws, but now that it received the double buffs, I would survive even if I was bitten by the creature itself.\r\n\r\n \r\n\r\nThis, is all yours. So I am going to avenge you.\r\n\r\n \r\n\r\nI walked slowly out of a gap in the wall where I was hiding. I could see a giant monster lurking at the far end of the wide corridor.\r\n\r\n \r\n\r\nLauchitas. Grade 1 polyp. The Dragon King of Poison and Curse. It had only appeared twice so far and both times were deemed as a non-combatant because its Dungeon door was closed.\r\n\r\nThe red dragon with three heads was looking at me. Among the three heads, the middle one’s eyes had been burnt out. The Lauchitas was very resilient, but it seemed that even it could not recover in such a short period of time from the injuries caused by Yuhyun’s blood.\r\n\r\nYeah, my younger brother’s great. Now I have double the abilities of that great younger brother \r\n\r\n \r\n\r\nFuck. You’re dead.\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n<Regression (1)> End', 'Geunseo', 'psikiologi, action, ', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068551373905, 'thrashof the counts family ', , 'When I opened my eyes, I was inside a novel. [The Birth of a Hero]. [The Birth of a Hero] was a novel focused on the adventures of the main character, Choi Han, a high school boy who was transported to a different dimension from Earth, along with the birth of the numerous heroes of the continent. I became a part of that novel as the tr*sh of the Count’s family, the family that oversaw the territory where the first village that Choi Han visits is located. The problem is that Choi Han becomes twisted after that village, and everyone in it, is destroyed by assassins. The bigger problem is the fact that this s*upid tr*sh who I’ve become doesn’t know about what happened in the village and messes with Choi Han, only to get beaten to a pulp. “…This is going to be a problem.” I feel like something serious has happened to me. But it was worth trying to make this my new life.', 'Trash of the Count’s Family – Chapter 2 – When I Opened My Eyes (1)\r\n\r\nThe man could feel someone gently tapping his body. The rough hand made the man think of the hands of an exhausted parent. It was that warm.\r\n\r\n“Young master, it is morning.”\r\n\r\nBut the voice was very profound. The man felt chills throughout his body and his eyes subconsciously opened. Rather than the bright sunlight coming in through the window to warm the man’s eyes, what he saw was an old man standing there with a satisfied expression.\r\n\r\n“It is surprising to see you wake up after a single attempt.”\r\n\r\n“Huh?”\r\n\r\n“The master wishes to dine with the young master since it has been a while. It looks like it will be possible today.”\r\n\r\nThe man could see a mirror past the old man’s shoulder. Inside the mirror was a red-haired man who seemed to be confused looking back at him.\r\n\r\n‘I guess that guy is me.’\r\n\r\n“Young master Cale?”\r\n\r\nThe man turned toward the source of the worried voice to find the old man, who looked like a servant, looking toward him. But that concerned man was not the problem.\r\n\r\nThe man clearly heard it.\r\n\r\nYoung Master Cale. It was a familiar name. He slowly blurted out the name.\r\n\r\n“Cale Henituse?”\r\n\r\nThe old servant was looking at him like he was looking at his own grandson.\r\n\r\n“Yes. That is your name, young master. I’m guessing you are still a bit drunk.”\r\n\r\nListening to the concerned response of the old man, the man naturally thought about a name that was even more important than the name Cale Henituse.\r\n\r\n“…Beacrox.”\r\n\r\n“Are you talking about my son?”\r\n\r\n“…Chef.”\r\n\r\n“Yes. My son is the chef. Do you need him to make something for your hangover?”\r\n\r\nThe man felt his surroundings turn dark and he started to feel dizzy. He lowered his head and put it into his hand.\r\n\r\n“Young master, are you still drunk? Should I call the doctor? Or will you wash right now?”\r\n\r\nThe man looked at the red hair that was falling in front of his face. It was a bright red color, much too different from his original black hair.\r\n\r\nCale Henituse. Beacrox. Beacrox’s dad, Ron.\r\n\r\nThey were the characters that appeared at the beginning of [The Birth of a Hero], the novel the man was reading before he fell asleep last night.\r\n\r\nHe jerked his head up and looked around. He could see the bedroom that was completely different from a typical Korean design. It made the man think about Europe. Every single thing in the room was extremely extravagant and luxurious.\r\n\r\n“Young master?”\r\n\r\nThe man responded to Ron, the old man who was pretending to be concerned and worried.\r\n\r\n“Cold water.”\r\n\r\n“Excuse me?”\r\n\r\nHe needed something to clear his mind. He could see the face of Cale Henituse in the mirror behind old man Ron.\r\n\r\n‘Still looks normal.’\r\n\r\n‘I guess Cale hasn’t been beaten to a pulp by the main character just yet. ‘\r\n\r\nHis handsome face caught his attention.\r\n\r\nThe man had become Cale Henituse when he opened his eyes.\r\n\r\nCale Henituse. The trash who was beaten to a pulp by the main character in the beginning of [The Birth of a Hero]. That was who he was.\r\n\r\n“Young master, I presume you will not be bathing in cold water. Are you asking for drinking water?”\r\n\r\nCale turned his gaze toward Ron. Ron may be pretending to be a benign old man, but he was actually hiding his true identity as a cruel and vicious individual.\r\n\r\nHe made the request to Ron.\r\n\r\n“Please get me some drinking water.”\r\n\r\nHe needed to drink some cold water and clear my mind first.\r\n\r\n“I will prepare it right away.”\r\n\r\n“Great. Thanks.”\r\n\r\nRon flinched for a second and had an odd expression on his face, but Cale did not notice it.\r\n\r\n***\r\n\r\nRon had to leave the bedroom as there was only warm water in the room. Once he was left alone, Cale got off the bed and headed to the bathroom. If he really was inside of the novel, he knew that there should be a large mirror inside.\r\n\r\nAs expected, the full body mirror was inside the bathroom. Cale Henituse, who had a lot of interest in his appearance and physique, had this mirror set up in here. Nobody else in the household had such a mirror.\r\n\r\nThe man in the mirror had red hair and a pretty fit body. It wouldn’t be wrong to say he had a body that would make any style look good.\r\n\r\n“I really am Cale.”\r\n\r\nThe man in the mirror indeed was Cale Henituse from the novel. [The Birth of a Hero] was very descriptive about each of the character’s appearance. That was why the man had no choice but to agree that he had indeed turned into Cale Henituse.\r\n\r\nDo people usually become calmer when they are surprised and shocked? Cale, no, Kim Rok Soo, calmly thought about the night before.\r\n\r\nIt was a typical day off. It had been a while since he had read an actual book instead of on his phone, so he went to the library to check out some books. He borrowed the entire series since he planned to read all day long.\r\n\r\nThe name of that book was, of course, [The Birth of a Hero]. He managed to finish the fifth volume before he fell asleep. But when he woke up, he had turned into Cale Henituse, the individual that the main character mercilessly beat up in volume 1.\r\n\r\n‘Will things go the way they did in the novel?’\r\n\r\nHe felt unnaturally calm. Once he got past the point of shock, his mind had calmed back down. He started to remember the contents of volume 1.\r\n\r\n[The Birth of a Hero.]\r\n\r\nThis novel was about the birth of the heroes in the Western and Eastern continents, as well as their trials and growth. The main character was, naturally, Korean. He was a student who had been transported into the world when he was a freshman in high school. Furthermore, his lifespan became as long as a dragon’s lifespan, making him pretty much never age.\r\n\r\n“… This is bad?”\r\n\r\nHe was going to be beaten into a pulp by such a person. The important thing, however, was that he had not been beaten up just yet.\r\n\r\nCale took his eyes off the mirror and walked into the tub that was full of warm water. He leaned against the tub and looked up at the ceiling. It was that expensive marble that was described in the novel. The estate that Cale lived in was actually full of marble.\r\n\r\nCale started to mumble as he looked toward the ceiling.\r\n\r\n“It’s not like there’s much I’ll miss.”\r\n\r\nHis life as Kim Rok Soo. There really wasn’t much to it. He was an orphan and didn’t have much money. He also didn’t have a person he loved to death, nor a friend he would give his life to save. He only continued to live because he could not die.\r\n\r\nYes, he could not die.\r\n\r\nHe completely hated the thought of death or pain. He became an orphan after both of his parents passed away from a car accident when he was little.\r\n\r\nHe didn’t like pain or death. No matter what it was, even if he was rolling in a pile of dog shit, it was still better than being dead.\r\n\r\n‘For that reason, I need to first make sure I don’t get beaten up.’\r\n\r\nCale did not know what day it was in the novel right now, but he was sure that he had not met with the main character just yet. The reason was simple.\r\n\r\n‘I don’t have the scar on my side.’\r\n\r\nCale Henituse, the trash of Count Henituse’s family. A few days before meeting the main character, Cale was drinking and causing a ruckus. He was flinging things around and got stabbed on his side by a broken desk leg, resulting in the scar.\r\n\r\nWhat an interesting character. He didn’t get the scar from fighting someone else. He got it because he got angry that the alcohol didn’t taste good and threw a tantrum. He meets the main character after he gets the scar, and, after a short discussion, he gets beaten to a pulp.\r\n\r\n“Mm.”\r\n\r\nCale crossed his arms and started to think.\r\n\r\nHe did not know what happened to Cale after getting beaten to a pulp in volume 1. All he knew was that the main character, Choi Han, has many fateful encounters and overcomes a lot of trials to grow into a hero along with his party members.\r\n\r\nThus the era for him to prove that he is a hero will begin. The Roan Kingdom that Cale currently lives in, as well as many other locations in the Eastern and Western continents, will be filled with war. It truly will turn into the time for the heroes to show their full potential.\r\n\r\nCale started to frown. Kim Rok Soo, the man who became Cale. His life motto was pretty simple.\r\n\r\nLiving long without pain. Enjoying the small joys of life.\r\nLiving a peaceful life.\r\n\r\n“… As long as I make the story proceed like normal while taking out the fact that I get beaten up, the main character will take care of the rest.”\r\n\r\nFor some odd reason, he could recall every single line in the book without any issue. Cale relaxed in the warm water while coming to a final conclusion with his now clear head.\r\n\r\n“It’s worth trying.”\r\n\r\nIt was worth trying to avoid the continent’s war and living peacefully. This trash’s situation was much better than when he was Kim Rok Soo. The location of this estate was also in the corner of the Western Continent, making it an ideal location to avoid the war. In the novel itself, there were many nobles who managed to avoid the influences of war. Even if he could not completely avoid it, he should be able to at least reduce the damages to a minimum.\r\n\r\n“Young master, are you inside the bathroom?”\r\n\r\nHe could hear Ron’s voice coming from outside. Cale thought about Ron’s true identity. Ron was an assassin who crossed over from the Eastern Continent by sea. He pretended to be a benign old man, but the true Ron was a cruel and merciless man.\r\n\r\n“Yes. I’ll be right out.”\r\n\r\nHis natural response was to talk informally to the old man. Cale realized what he was doing and made up his mind about what to do in the future.\r\n\r\nHe needed to push that old man to the main character and send him away.\r\n\r\nThat old man could easily kill Cale with a single blow, but treated Cale like a puppy you left alone because you felt bad for it. He was smiling gently, but there was not an ounce of care about Cale on the inside. In the novel, Ron leaves with the main character and his son after Choi Han beats Cale to a pulp.\r\n\r\nCale put the bathrobe on as he quickly exited the bathroom. Ron was standing there with a smile on his face and a tray with a cup in his hands.\r\n\r\n“Young master, here you go.”\r\n\r\nCale picked up the cup and walked past the old man. He did not want to make eye contact with such a dangerous old man.\r\n\r\n“Great, thanks.”\r\n\r\nRon’s expression turned odd once again, but Cale had already walked past him. Cale took a drink of the cold water as he started to think.\r\n\r\n‘There are too many strong people here.’\r\n\r\nIn fact, there were too many of them. No matter where the main character went, there were either strong individuals or individuals with hidden secrets. These individuals were both human and other races.\r\n\r\n‘I at least need the strength to protect myself.’\r\n\r\nIn order to live long without pain in the continent that will soon be filled with war, you needed a decent level of strength. Of course, you could not be too strong. Then other complicated things will happen.\r\n\r\nCale thought about the different fateful encounters that occurred in the beginning parts of the novel. The powers that strengthen the main character and his party members. He was thinking about the ones that would help him live long without pain. There were a couple that came to mind. He just needed to pick one of them.\r\n\r\n“Young master, we will start to dress you now.”\r\n\r\n“Oh, right. Thanks.”\r\n\r\nThe door soon opened and couple servants entered to help Ron dress Cale. Cale did not notice that Ron had a stoic expression unlike his usual self as he looked at the clothes the servants were bringing in.\r\n\r\n“Ah, something simple today.”\r\n\r\nHe hated really complicated attires. Simple clothes that let you relax comfortably were the best.\r\n\r\n“Yes, young master.”\r\n\r\nThe servant in charge of the attires quickly pulled out some simple clothes and Cale changed into the simplest of them all. He lightly frowned after finishing getting dressed. Even this, ‘simple,’ attire was extremely extravagant and not to his liking.\r\n\r\nHowever, the reflection in the mirror was quite handsome.\r\n\r\n‘He really is handsome and makes any clothes look good.’\r\n\r\nThe face really was the final piece to fashion. He looked in the mirror and fixed his sleeves before turning around to look at Ron.\r\n\r\nRon was once again smiling like a gentle old man.\r\n\r\n“Ron, let’s go.”\r\n\r\n“Yes, young master.”\r\n\r\nCale walked behind Ron. It was nice that he did not need to know the layout of the estate. He just needed to follow Ron wherever he needed to go. All of the servants that Cale saw flinched and bowed respectfully before they seemed to run away.\r\n\r\n‘Why are they so scared? Cale never hit people.’\r\n\r\nHe just liked to drink and play. Sometimes, when he was drunk, he did break things. But that was why he was the trash of the family. He also did not treat people like people, other than the few people he liked.\r\n\r\n‘Well, it’s better if nobody talks to me.’\r\n\r\nCale thought about it peacefully. It would be more difficult if he was in the body of a model citizen. A trash can do as he pleases without worry. It was only possible because there was no desire to live as a model citizen.\r\n\r\n“I will now open the door.”\r\n\r\n“Sure.”\r\n\r\nCale nodded his head toward Ron. The book mentioned that Cale treated Ron, someone who raised him like he was his own grandson since he was little, as nicely as he treated his own father. It mentioned that he always responded to Ron and treated him like a person. Of course, Ron did not really think that way. That was why it was easy for Cale to talk to Ron. He just needed to answer Ron’s questions and treat him like a human being.\r\n\r\n“I hope you enjoy your breakfast.”\r\n\r\n“Thanks. Ron, make sure you eat a good meal too.”\r\n\r\nCale walked past Ron and into the dining room. He could see his family sitting there. His father and the current head of the Henituse household, Deruth. Next to him was Cale’s step mother, the Countess, as well as her son and daughter. The four people looked toward Cale.\r\n\r\n“You are late again, today.”\r\n\r\nCale’s gaze turned toward his father who spoke. [The Birth of a Hero] described Cale’s feelings for his father like this.\r\n\r\n‘His father was the one person that Cale listened to. The reason the trash did not leave the area and got everything he wanted inside the Count’s territory was because of his father, Count Deruth Henituse.’\r\n\r\nBut, unfortunately, Cale’s father was unlike the other strong fathers in this novel. He did not have any special skills or influence. He just had a lot of money. However, Cale liked this a lot. It was the perfect family environment to live a simple life.\r\n\r\nThen there were the other three individuals.\r\n\r\nHis stepmother who knew that he did not like her and avoided him.\r\nHer smart first-born who found it difficult to deal with his much older brother Cale.\r\nAnd the cute youngest of the family who avoided her older brother Cale.\r\n\r\nBut it wasn’t like Cale bothered them or they bothered Cale. They just treated each other like strangers.\r\n\r\nCale thought this was such a great environment to quietly live alone.\r\n\r\n“Take a seat.”\r\n“Yes, father.”\r\n\r\nCale looked at the feast on the table that did not meet his definition of breakfast and sat down on his seat. He then felt something was odd and lifted his head up.\r\n\r\n“Is there something you need to say, father?”\r\n\r\n“… No, I do not.”\r\n\r\nDeruth was staring at Cale. The rest of the family was doing the same. Cale made eye contact with each of these family members. They all quickly turned away whenever he made eye contact and continued to eat.\r\n\r\n‘I guess they find me really difficult to handle.’\r\n\r\nCale turned his head toward the table as well. This luxurious feast that was different than the breakfast he used to eat just to fill his belly made him start to smile. He first started by cutting the sausage in half with the knife.\r\n\r\n‘It is so juicy.’\r\n\r\nHe didn’t know if juice flowed out as soon as he cut into it because it was handmade or because it was cooked well, but the color on the sausage made him hungry. Cale started to smile without realizing it.\r\n\r\nClang.\r\n\r\nHe heard something fall down and made eye contact with his younger brother Basen. He could see that Basen had dropped the fork in his hand.\r\n\r\n“My apologies.”\r\n\r\nBasen calmly apologized like the personality described for him in the novel. The servant in charge of the meal quickly came over to hand Basen a new fork and picked up the fork on the floor. Watching that made Cale think that it was nice to be a noble, before he focused once again on the food in front of him.\r\n\r\nCale had found the first good thing about coming into the novel. This breakfast was extremely luxurious and so tasty that his stomach was completely happy.\r\n\r\nThe smile on his face could not disappear.\r\n\r\n“…Ho?”\r\n\r\nThat was why he did not hear his brother Basen’s shocked proclamation.', 'Yoo Ryeo Han', 'psikiologi, action, comedy ', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068555678718, 'Manowa', '', 'When she came to, she was in another world. A world just like the stage of a popular game, the girl “Kazane” collects and fights with monster skills in a Hyper Learning Story. Before she realizes it, she’s saved a town, exposed a scandal, met a ghost, saved a princess, went into a hot spring, and spent her time going to the hot spring daily with her party. In the fight against the approaching devil, Kazane confronts her own dark side during her destined reunion with the Big Cat. Did I mention she also spends time at a hot spring?', 'I’m looking at the sky.\r\nA little girl is looking at the sky.\r\nAh, what a beautiful blue sky.\r\nAdmiration leaks from that girl’s mouth.\r\nA sudden expanded world.\r\nAn opened grassland.\r\nRemains of a decaying ruin.\r\nA flowing brook.\r\nA far away mountain range.\r\nAs if it was the Iota’s region in “Zexiahart Biography of Illusions”… she thought in a daze.\r\n\r\n“Eh?”\r\nThat’s why that girl is confused.\r\nRaising her lying body, she looks at the soil in her hand.\r\n“Soil.”\r\nA natural confirmation. But it’s a truth that is not natural in any way.\r\n\r\n“Where is…this?”\r\nWhile pressing her head as her thoughts starts to be clear, she stands.\r\nThen she once again feels confused. Where is this? She has no recollection whatsoever about this place.\r\n\r\nNo, wait.\r\n“I think…I know this place. That ruin…is Signa Ruin. That mountain peak…it’s Jiltia mountain range…and that river is connected with Rull river.”\r\n\r\nAs it was smoothly said from that girl’s mouth, she convinced herself that this is not an unknown place. However, she being here is something that is impossible.\r\n\r\n‘Why’, you ask?\r\n“This is…inside the game?”\r\nThe answer to her doubt escaped from her mouth. An impossible truth.\r\n“What’s happening?”\r\nIn a fluster that girl scans the area. This place is affirmatively not her own room, where she was awhile ago.\r\n\r\n“I was at my room until awhile ago, right? I don’t remember coming here…”\r\nThen that girl saw the ruin. Moss grew densely at the stone paving, indicating that there is no one who have ever touched it in months or even years. Well if it was only that then it might be fine. What if the idea of being in her room is her own misunderstanding, and the truth is that she was on a vacation abroad and she had hit her head in front of Mohenjodaro ruin, then she lost her memory?\r\n\r\n“Well, as I thought it’s unrealistic.”\r\nIf only there’s no floating stone in the air.\r\n(If I remember it correctly, Signa Ruin is a magic temple created to manufacture floating stone…that was the setting)\r\nAt the tutorial quest in the beginning of the game, Signa Ruin was explained as a place to produce floating stones that were used in the creation of flying ships.\r\n\r\nI mentioned \'was\' because now it has been abandoned. After players drifted as emigrants in the town and registered as adventurers, the first quest urged players to pick the floating stones.\r\nThose who took this quest would have surely learnt the basics such as purchasing item, using equipment, and fighting or fleeing from monster.\r\n\r\n(eh, wait!)\r\nAs she saw the ruins, dumbfounded, cold sweat starts to trickle down.\r\nShe thought back to her current status. This place is the tutorial quest ruin. This is the tutorial quest last checkpoint. The stage of the first boss fight.\r\n\r\n(no way!?)\r\nShe feels beast presences from around her.\r\n(uwawawawa)\r\nCountless breathing sounds. Inhuman footsteps.\r\n“Command Open.”\r\nFollowing her words, various windows appears around her.\r\n“Oh, they appeared! So this is really a game?”\r\nShe still thinks it as unreal, but she believed that this is inside the game and she opens the status menu.\r\n\r\n“Yuihama Kazane, um it’s my name.”\r\n(But I never used my real name when playing--)\r\nWhile thinking she might have become senile, she—Yuihama Kazane, confirms the other parameter.\r\n(Level 8? So it stays in the initial value. It’s not the one I used to play. Weapon, armor is…just normal clothes)\r\nThe one I wear here is the clothes I wore at home, a baggy tank top and shorts, plus somehow I\'m also wearing sneakers. The defensive capability is just as pathetic as it sounds.\r\n\r\nThere’s no way I can fight. As Kazane judges it that way, for her next option she turns on the display visualization.\r\n(Geh!!)\r\nAs she did so, in the plain with overgrown grass surround her several windows have appeared one after another.\r\nGoblin level 12. Typical Goblin tribe, but there are a lot of them.\r\n(17, 18, 19, 20. Twice the amount of when it was a game. No way. Seriously, no.)\r\n\r\nAs she realizes that she is in an absurd situation, she takes a deep breath in resignation. The boss in this quest is usually fixed at 10 goblin tribes. And now it’s twice the number.\r\nWith ‘High Freedom, High Reality’ as it\'s catchphrase, a lot of the battles in Zexiahart were extremely strict.\r\nFor example, battling against twenty, no, even if it were just ten goblins, fighting while the character stats is still at the initial stage would mean certain death. Originally if you didn’t follow instructions from the guild to break them apart and kill them one by one, you will most likely die. That’s why the quest in Signa Ruin was often called as the ‘Beginner Killer’.\r\n\r\n(They encircled me in an instant…well, of course)\r\nEven If I fight, I can’t win. Just to be sure I checks the skill column, but of course it is empty. Running into the grassland is also reckless. As I have no weapon, if it become a hopeless situation my option will be limited.\r\n\r\nGulp… Kazane swallows her saliva.\r\n“U, Uwaaaaaaa!!!!”\r\nInstant judgement. She shouts with her might and run away.\r\n“Gyaga!” “Agaijigigi!!?” “Jareaganii!!”\r\nIgnoring the shouts behind her, Kazane run without turning back. Into the Signa Ruin.\r\n\r\n(Game! Game! Game! This is a Gaaaameeee!!)\r\nAs she shouts in her heart while feeling dreadful presences closing by, she run along the stone paving and enter the entrance of the ruin, and there she hit the protrusion in the wall.\r\n\r\n“Gyahaaga!”\r\nDreadful voices, accompanied with the sounds of something crushed enters her ears.\r\n(Gu!)\r\nThe smell of metal stimulate her nose.\r\nAs Kazane saw the source of that smell, she feels the urge to throw up.\r\n\r\n“Are you kidding?”\r\nWhat was there were the shadows of the things that chased after her. Smashing the stone entrance, the gore objects with something in their mouths and eyes. It’s too real and hard to think of it as a game, they were objects of extremely nasty visual.\r\n\r\n“Ugu”\r\nKazane instantly averts her eyes. If not, she might seriously throw up. It’s a high grade spectacle that no high schooler who was enjoying her game in an air conditioned room awhile ago can bear. That’s why, it’s her limit.\r\n\r\n“In any case…I am saved right?”\r\nWhile wiping acid like stuffs near her mouth, in a place a bit ahead the entrance, Kazane muttered. The inside of her mouth felt sour.\r\nThen while chasing away the previous scenes from her head, she tries to calm down.\r\n\r\nThe inside of the ruin is dark, but not on a level where someone can’t see anything. In this kind of ruin, a lot of glowing moss called shining moss grew in the wall as part of the setting. Moreover the ceiling part is created in a way that allows sunlight to enter.\r\n(Since that mechanism can be used, then this place is really inside Zexiahart, right?)\r\n\r\nNow it’s certain. The previous mechanism was to be used as emergency evasive way if you were surrounded by goblins in the tutorial quest. It’s a structure designed that if you hit the protrusion in the right side of the entrance, the door will open.\r\nThe door will open again after a fixed amount of time, and the goblin will still be waiting outside so nothing would really change, but it can be used to buy time and prepare on how to deal with them. Repeating to come and go while slowly annihilating the goblins is possible. If this is inside the game.\r\n\r\n“But as I thought, without weapon it’s impossible to kill them all.”\r\nEven while boasting like that, Kazane actually feels that the premise of this being a game starts to crumble apart from the smell of the door and her tiredness from running with all her might before.\r\n\r\n(Then…perhaps a dream?)\r\nThere’s something called lucid dream. It’s a dream where you would still be self aware that you’re inside a dream, but with the sensations she feels, it’s hard to say if it’s just a dream.\r\n(Well… but it might be a dream since I feel like this)\r\nPlaying a game inside her own dream is also plausible, but the thought that she had played Zexiahart over 3000 hours until it appears in her dream made her smiled bitterly.\r\n\r\n“Well, either way. Since I will fight…I must win.”\r\nWhile saying so, Kazane looks at the inside of the ruin. Since the those goblins were the monsters of this ruin, there should be no more monster here.\r\n“I really appreciate it if they don’t come. Seriously.”\r\n\r\nEven if this is a game, with this kind of equipment, no matter what monster appear, she won’t win. If this is reality then even more so. But if she enter this ruin, then there might be a way.\r\nWhile thinking like that she walks forward, and from right beside her she heard a voice that she recognized, and the thing that is swinging down at her is…\r\n', 'Shien', 'Action ,Adventure, Comedy ,Fantasy ,Romance', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068555898552, 'Extreme Flame Wizard', , '“From today onwards you are no longer my son. Get out” Being born into a noble family that is aiming to become the ‘strongest’, at his aptitude ceremony held on his 12th birthday it was discovered that Igni could only use fireballs. Igni who can only use beginner level magic was kicked out of his house. With no where to go and without much magical ability, Igni is scraping by through life. However, one day he has miraculous reunion. “What? Is that Igni there?” “Gr-grandpa!?” It was a reunion with his grandfather, the man who was once called the strongest [Kyokuten] but was banished from his noble family because of his excessive womanizing…! “Grandpa! You said strong men are popular, but I can’t be strong!!” “Igni, listen carefully. Strong men are popular but, hard-working men are even more popular!!” “Grandpa! I’ll try my best!!!” Igni whose parents who banished Igni from the house, didn’t yet know of his obsession with being popular under the guidance of the strongest [Kyokuten] magician…! “Igni that magic!” “This? It’s a fireball” “With this you can aim for [Kyokuten]! Come back here!!” “Nobility isn’t popular” “What are you saying?” This is a story where a young magician becomes the strongest by honing his skills all in order to become popular. ', 'Chapter 1: Lecture Concerning Compatibility\r\n\r\n\r\n“Oye Igni, listen well.”\r\n\r\n\r\nIgni did not take his eyes off the man sitting in front of him.\r\n\r\n\r\nIt’s no secret that the man before him is one of the strongest in the world.\r\n\r\n\r\nHe is none other than the “Extreme Wizard.”\r\n\r\n\r\nHe has aged, sure, but he has mastered the magical arts, and against any common foe, he would turn them to ash in less than a second.\r\n\r\n\r\nIgni: “What’s up, grandpa?”\r\n\r\n\r\nIgni suppressed his nervousness as he inquired his grandfather.\r\n\r\n\r\nHis white hair tied in a ponytail, his grandfather wore a robe that covered most his wrinkled skin.  Even at his age, his eyes still looked like a hunter searching for his prey. \r\n\r\n\r\nLucas: “The Secret Art of Being Popular - Lesson #1.  ‘WOMEN LOVE STRONG MEN!’”\r\n\r\n\r\nIgni: “W...women love strong men!”\r\n\r\n\r\nThe one known as “Extreme”, one of the strongest wizards ever known, spoke solemnly and seriously with his grandchild.\r\n\r\n\r\nLucas: “Yes, I have been loved and adored by women because I became the strongest.”\r\n\r\n\r\nIgni: “Because Grandpa is the strongest!”\r\n\r\n\r\nNo one doubted this fact.\r\n\r\n\r\nIf you ask 100 people passing by, all 100 would say that grandpa is the strongest.\r\n\r\n\r\nLucas: “That is why, Igni, the upcoming ‘Compatibility Ritual’ will determine everything!” \r\n\r\n\r\nIgni: “O-Okay!”\r\n\r\n\r\nThe Compatibility Ritual.  This was a custom carried out by every country in the world.\r\n\r\n\r\nMagic - a source of power beyond human strength.\r\n\r\n\r\nThat magic was broken into several various types.\r\n\r\n\r\n[EARTH] ・[WATER]・[FIRE]・[WIND]・[LIGHT]・[DARK]・[LIFE]\r\n\r\n\r\nAll children reaching 12 years of age attended the Compatibility Ritual to learn their Magical compatibilities and affinities to any of the major types of Magic.  \r\n\r\n\r\nOnce they know what kind of magic they are compatible, that itself will determine their future.\r\n\r\n\r\nThere are those who research magic.\r\n\r\n\r\nThere are those who become adventurers.\r\n\r\n\r\nThere are those who abandon all hope in the magical arts and live a common life.\r\n\r\n\r\nLucas: “Igni! If you want to be popular with women, you will have to be compatible with the strongest of types!”\r\n\r\n\r\nIgni: “The...strongest… type?!”\r\n\r\n\r\nLucas: “Yes, and that strongest type is…”\r\n\r\n\r\n<<<<>>>>\r\n\r\n\r\n“Igni.  Igni!  Are you awake?”\r\n\r\n\r\nIgni: “Y-Yes father!”\r\n\r\n\r\nIgni woke up to his father’s voice..\r\n\r\n\r\nIt looks like he was having that dream again when he met his grandfather a week ago.\r\n\r\n\r\nEven though he just fell asleep in the carriage, Igni’s father burned red with anger.\r\n\r\n\r\nFather: “Oh please! You don’t listen to anyone when they’re speaking.  You leave home without permission.  Do you even understand your position as the first born son of this family?!”\r\n\r\n\r\nIgni: “I’m… I’m sorry, father…”\r\n\r\n\r\nIgni shrunk back in his seat.\r\n\r\n\r\nFather: “Why is it that your younger brother Fray is so much more advanced than you are?  How could you be so useless?”\r\n\r\n\r\nFray: “Father, please do not scold my brother.  He was staying up late last night studying and must be tired.”\r\n\r\n\r\nIgni was embarrassed that his brother had to cover up for him.\r\n\r\n\r\nFather: “Do you understand?  We are going to the Awakening Ceremony, and you MUST inherit the [LIGHT] trait.  The Talcoyz Family trait must be carried on!”\r\n\r\n\r\n“ \"Yes, father.\" \"\r\n\r\n\r\nBoth nod their head in agreement.\r\n\r\n\r\nFather: “Affinity to any other trait is unforgivable.  The Talcoyz Family has always been a Clan of Light.  We MUST have someone become the “Extreme.”  ...if only if it wasn’t for that despicable man…”\r\n\r\n\r\nIgni’s father curses as he spat out the words.\r\n\r\n\r\nThat despicable man.\r\n\r\n\r\nYou didn’t have to ask who he was talking about.\r\n\r\n\r\nAlthough he was the first “Extreme” in the family lineage, his various associations and relationships with women almost destroyed the family’s reputation.  This was Igni’s grandfather - Lucas Talcoyz.\r\n\r\n\r\nBut now, he is simply Lucas after he was expunged from the family tree and purged of his Talcoyz last name.\r\n\r\n\r\nIgni’s father has called him the worst atrocity to incur upon the family, and the utmost embarrassment.\r\n\r\n\r\n“A noble must live as a noble does”\r\n\r\n\r\nThis is what Igni\'s father always tells us.\r\n\r\n\r\nAs Igni was thinking about this, the carriage stopped.\r\n\r\n\r\n...they must have arrived at the church.\r\n\r\n\r\nPeeking outside, he sees other children his age nervously entering the church premise.\r\n\r\n\r\nFather: “Igni and Fray.  Don’t disappoint me.  Approach this with the utmost importance.  We MUST gain another Extreme for the sake of the family.”\r\n\r\n\r\nIgni: “...I understand, father.”\r\n\r\n\r\nFray: “Of course, father.”\r\n\r\n\r\nIgni and Fray bow before leaving the carriage.\r\n\r\n\r\nThey mix-in with the group of children, and on their way to church, someone taps Igni’s shoulder.\r\n\r\n\r\n“Have you been well, Igni?”\r\n\r\n\r\nIgni: “Oh, Rose?”\r\n\r\n\r\nHe was surprised to find who was behind him.\r\n\r\n\r\nBehind Igni was Rose Aquilmarun.  \r\n\r\n\r\nShe is the only child and daughter of the prestigious family Aquilmarun.  And she is also Igni’s fiancé.\r\n\r\n\r\nWith sky blue hair and almost transparent blue eyes, she is an extraordinarily beautiful girl.\r\n\r\n\r\nRose: “Let’s do our best today, Igni.”\r\n\r\n\r\nIgni: “Yes!”\r\n\r\n\r\nRose: “I’ll be [WATER].  Igni, you be [LIGHT].  Together, let’s both become ‘Extreme’s.”\r\n\r\n\r\nIgni: “Of course!”\r\n\r\n\r\nThis was a promise they made when they were 6.\r\n\r\n\r\nRose brings this up every time they see each other, and Igni can’t hide the embarrassment that wells up inside him every time this happens.\r\n\r\n\r\nFray: “Brother, we all know that I’m going to be the ‘Extreme‘ and not you.”\r\n\r\n\r\nIgni: “Haha.  Sure, then let’s see who’ll get there first.”\r\n\r\n\r\nFray and Igni are step brothers of the same age.\r\n\r\n\r\nBut they have gotten along just fine up until now.\r\n\r\n\r\nFray has many strengths which Igni lacks, but even so, Fray has supported his brother up till now.\r\n\r\n\r\nRose: “Look at all those priests, Igni!”\r\n\r\n\r\nIgni: “R-Rose, you shouldn’t point at priests like that…”\r\n\r\n\r\nInside the church, the typical 1 priest turned into 10.\r\n\r\n\r\nLooking intently into a magic crystal, all the priests shouted the affinity and compatibility of each child.\r\n\r\n\r\n“[WATER] : [B]!”\r\n\r\n\r\n“WHOA! B-Rank?!”\r\n\r\n\r\nYou heard the shouts come up from the crowd.\r\n\r\n\r\nRose: “Look, at B-Rank, isn’t that amazing?”\r\n\r\n\r\nIgni: “Don’t worry.  We’ll even top that.”\r\n\r\n\r\nThe priests will only shout the magical trait you are most compatible with.  Other affinities and traits will be spelled out in something called a “Status” which is written on this board they give you.\r\n\r\n\r\nThe common rank is D or lower.\r\n\r\n\r\nThe boy who discovered his B-Rank had a wide-spread smile on his face.\r\n\r\n\r\n“[LIGHT] : [D]!”\r\n\r\n\r\n“[FIRE] : [C]!”\r\n\r\n\r\n“[DARK] : [E]!”\r\n\r\n\r\nThe priests continue to process each child swiftly and efficiently.\r\n\r\n\r\n“Next!  Come forward!”\r\n\r\n\r\nRose: “It’s...it’s my turn.  Here I go.”\r\n\r\n\r\nRose was called and steps forward.  She looks nervous and stiff as she walks to the priest.\r\n\r\n\r\n“Oh… this is…?!”\r\n\r\n\r\n“D-did something happen?!”\r\n\r\n\r\nThe priest who looked the most extravagantly dressed peered into the crystal and widened his eyes.\r\n\r\n\r\n“Th-this, could this be?!”\r\n\r\n\r\n“Is something wrong?!”\r\n\r\n\r\n“H- [HOLY] : [S]...”   \r\n\r\n\r\nThe priest trembled as he spoke the words.\r\n\r\n\r\nA [HOLY] Trait?!?!\r\n\r\n\r\nAt the news, murmurs erupted from the crowd with Igni.\r\n\r\n\r\n“Th-the [HOLY] Trait?!?!  That trait that only appears every 100 years?!?!”\r\n\r\n\r\n“And she’s S-RANK?!  This has to be some sort of joke, O Holy Priest!”\r\n\r\n\r\n“I… I am not joking…!  The crystal never tells lies….!”\r\n\r\n\r\nThe priests began to hurriedly run about, as Rose just stood there in disbelief.  \r\n\r\n\r\n“That can’t be?!  A [HOLY] Trait S-RANK?!”\r\n\r\n\r\n“There’s never been any occurrences like that…”\r\n\r\n\r\n“It’s...it’s the beginning of a legend!!”\r\n\r\n\r\nThe crowd is even more excited than the priests.\r\n\r\n\r\nI wonder if Rose even understands that meaning of this news.\r\n\r\n\r\nThe [HOLY] Trait is a tier higher than the [WATER] trait, and any person who inherits this trait is determined as a saint, and the country will protect them with the utmost urgency.\r\n\r\n\r\nAnd what’s even more shocking is that an F-Rank [HOLY] Trait is several levels ABOVE an S-Rank [WATER] trait.\r\n\r\n\r\nThe S-Rank of the highest of highest tiers.\r\n\r\n\r\nRose has already one foot set in the Extreme realm.  It’s only a matter of time now.\r\n\r\n\r\nUnbeknownst to everyone around him, Igni’s heart beat strongly in his chest.\r\n\r\n\r\n“...Ahem.  You are the child of Aquilmarun, are you not?  You will receive a letter from the King later today.  Until then, the Royal Guards will keep you safe.  Do not fear.  It only means that you have been blessed with more talent than the average person.  The next child, come forth!”\r\n\r\n\r\nFray is called up next.\r\n\r\n\r\nIgni: “You got this!”\r\n\r\n\r\nFray: “Thank you, brother.”\r\n\r\n\r\nFray steps forward.\r\n\r\n\r\n“Oh, you are a child of the Talcoyz, are you not?”\r\n\r\n\r\nFray: “Yes I am.”\r\n\r\n\r\n“Then let’s begi…  what?!”\r\n\r\n\r\n“What is it now?!”\r\n\r\n\r\n“No, this...this can’t be…”\r\n\r\n\r\nThe priest again shows disbelief at what is shown to him through the crystal.\r\n\r\n\r\n“[EXTREME LIGHT] : [SS]”\r\n\r\n\r\n“E-[EXTREME LIGHT]?!”\r\n\r\n\r\nThe higher tier above the Light trait, the Extreme Light, and he’s a SS-rank?!?!\r\n\r\n\r\nThat’s another trait that only appears every 100 years or so.\r\n\r\n\r\nBut that’s not the most surprising thing about this.\r\n\r\n\r\nThe tier above the Light tier is only heard of in fairy tales.\r\n\r\n\r\nAnd Fray inherited it!\r\n\r\n\r\n“We have two upper tiers.”\r\n\r\n\r\n“We are really lucky this year.”\r\n\r\n\r\n“NEXT! Come forth!”\r\n\r\n\r\nIt’s finally Igni’s turn.\r\n\r\n\r\nIgni: “Y-Yes!!”\r\n\r\n\r\nIgni steps forward.\r\n\r\n\r\nRose: “Good luck.”\r\n\r\n\r\nRose whispers encouragement quietly into his ear.\r\n\r\n\r\n….yes, for sure.  I’m going to give this my all.\r\n\r\n\r\nAlright, what kind of trait am I going to have?\r\n\r\n\r\n[LIGHT]?  Or maybe [EXTREME LIGHT]??\r\n\r\n\r\nOr maybe [DARK]?\r\n\r\n\r\nOr maybe something even more legendary and mythical like a unique [ORIGINAL] trait?!\r\n\r\n\r\nAs Igni’s excitement boils over, the priest quietly pronounces.\r\n\r\n\r\n“[FIRE] : [F]”\r\n\r\n\r\nAt that moment, the entire church fell silent.\r\n\r\n\r\nIgni: “....Excuse me?”\r\n\r\n\r\n“What?  You didn’t hear me?  [FIRE] : [F]”\r\n\r\n\r\nIgni: “....w---wait wait wait wait wait.  No, no no no, that can’t be.”\r\n\r\n\r\nHis mind goes blank.\r\n\r\n\r\nSomething ice cold crawls down his spine.\r\n\r\n\r\nThat’s impossible!  His most compatible trait is [FIRE]?!  \r\n\r\n\r\nAnd he’s an F-RANK?!?!\r\n\r\n\r\nIgni: “...one more time.”\r\n\r\n\r\nPlease, check again.\r\n\r\n\r\nBut before those words left his left, the priest called to the next child.\r\n\r\n\r\n“NEXT, COME FORTH!”\r\n\r\n\r\n….it’s over.', 'Shikuramen ', ' Action ,Adventure,Comedy , Fantasy,  School Life,', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068555992698, 'Kojiin Tamer', , 'Shu, who died of old age, reincarnated as a baby in a different world where he was picked up by a poor orphanage. He quickly grows up under the watchful eye of the gentle director and staff. With skills received from God, he starts to exert talent…. He now lives at his own pace, adventuring with cute monsters and good friends ', 'KT Chapter 1\r\n\r\n「Huhh, this is…?」\r\n\r\nWhen I opened my eyes, I saw a person standing there in the boundless pure white space.\r\n\r\nAfter restlessly looking around,\r\n\r\n「Yaah」\r\n\r\nsounded.\r\n\r\nThe one who called out to me, was a boy around ten years old.\r\n\r\n「Who are you? Or rather, just where is….」\r\n\r\n「This place? This is a place similar to that of a space that connects the present world with that world.」\r\n\r\nThat world…?\r\n\r\n「Which means, I died!?」\r\n\r\n「That’s right! You had a peaceful death at the age of 101.」\r\n\r\n101 years old!? Then, I had died at the end of my lifespan? However, I had no memory of my death, and why, was I here?\r\n\r\nWas I actually still alive…?\r\n\r\nIn the first place, who in the world is this child???\r\n\r\n「Ahaha, it seems that I’ve confused you. Firstly, why don’t I introduce myself. I am someone who you would call a god. And, you are currently an existence known as a soul.」\r\n\r\n「God? Soul!?」\r\n\r\n「Why don’t you take a look at yourself? Even though you were 101 years old, don’t you think that you look young?」\r\n\r\nWith that being said, I looked down, but my body did not resemble one that belonged to an ojiichan and was instead a youthful one, looking to be around twenty years old.\r\n\r\n「As one would expect, if I had summoned your body that you had when you died, we wouldn’t even be able to talk~.」\r\n\r\nFumu, certainly, I wasn’t even about to talk when I was 101 years old, and if it’s senility, then it’s possible that I would have no memory of my death.\r\n\r\n「However, why am I here?」\r\n\r\n「Un, I have something I want to ask of you.」\r\n\r\n「Something to ask of me?」\r\n\r\n「Actually, I want you to go to another world.」\r\n\r\n「Another world???」\r\n\r\n「That’s right, another world!! You like that kind of thing, don’t you?」\r\n\r\nHaving said that, certainly, I had always liked novels, manga, and anime. I was a so-called otaku. However, were there actually other worlds?\r\n\r\n「The humans of your world are not aware of it, but transmigrations and reincarnations to another world had always been, a rare occurence.」\r\n\r\nTN: other world transmigrations and reincarnations are similar, but not the same. Transmigration is moving from one world to another, often in one’s original body. Reincarnations, on the other hand, can be classified as the movement of the soul from one world to another. In other words, after one dies in one world, the soul will be transferred to another world and be born again, thereby gaining a body that originated from that new world. \r\n\r\nWhat, to think that such manga-like situations actually existed….\r\n\r\n「Maa, it would be bad if the other world was strangely influenced, so there is a screening of the people who are sent over though.」\r\n\r\n「Then, this time, I had been selected?」\r\n\r\n「That is correct!! Since you have had a peaceful life. You could even think of it as a bonus stage.」\r\n\r\nBonus stage, huh….\r\n\r\n「You don’t have to do it, so it’s fine even if you refused?」\r\n\r\nU~n, I didn’t particularly have any reason to refuse.\r\n\r\n「Then, I want to try going to another world.」\r\n\r\n「Really? That’s great~. Incidentally, the world that I’ll have you go to is one where swords and magic exists.」\r\n\r\nMaa, that’s expected.\r\n\r\n「Then, what should I do when I get there?」\r\n\r\n「Nothing really, it’s fine to just live there normally.」\r\n\r\nIt’s ok to not do anything?\r\n\r\n「In the first place, it’s not like nothing will change when you go, and if I wanted to change something, it would be faster to send an expert. 」\r\n\r\nOf course it is.\r\n\r\n「That’s why, enjoy your second life!!」\r\n\r\n \r\n\r\n「So, am I going right away?」\r\n\r\n「No, no, I can’t let you go that quickly. I need to explain a little about that place.」\r\n\r\n「Ehh? Is there something!?」\r\n\r\n「Since it’s completely different from your original world. There’s magic, monsters, and alchemy instead of science. It’s truly a world of royal road.」\r\n\r\nUn, it was truly a conventional another world reincarnation.\r\n\r\n「You will reincarnate as an orphan at an orphanage. Even if I say it’s a reincarnation, the body is created by me though.」\r\n\r\n「That’s, doesn’t that mean I will be born as someone’s child?」\r\n\r\n「If that’s the case, then the child that was scheduled to be born would die!!」\r\n\r\nAah, is that so.\r\n\r\n「Then, since I’m purposely sending you to another world, I’ll give you a small bonus.」\r\n\r\n「Bonus?」\r\n\r\n「It’s Language Translation. Since it’ll be troublesome to learn a new language from the very beginning. Ahh, I’ll make it so that you’ll be able to write the words as well.」\r\n\r\n「That certainly does help.」\r\n\r\n「Next, it’s the Item Box.」\r\n\r\n「That’s standard.」\r\n\r\n「There’s not many people who have an item box, so be careful.」\r\n\r\n「Got it.」\r\n\r\n「Finally, there’s Appraisal.」\r\n\r\n「It’s the lineup of the three sacred treasures.」\r\n\r\n「Is there anything else that you need? I’ll give it to you if it’s not too strange though?」\r\n\r\n「In that case, then of course, I’d like to be able to use magic.」\r\n\r\n「Which kind of magic?」\r\n\r\n「What kind is there?」\r\n\r\n「There’s a variety of them. There’s the basic fire, water, wind, earth as well as light and dark, space, alchemy, blacksmithing and lifestyle; choose as many as you’d like!!」\r\n\r\n「So many…. This, do I need to have the aptitude?」\r\n\r\n「Fundamentally, that is so. Those residing in the other world usually have one or two attributes.」\r\n\r\n「Then, wouldn’t it be better that I would have around the same amount?」\r\n\r\n「U~n, it doesn’t really matter how many you have though…. That’s right, then why don’t I give you Magic Manipulation? Then, you’ll be able to use most magic!!」\r\n\r\n「Is that so?」\r\n\r\n「The people in that world need to memorize the incantations and practice them in order to use them, but that’s because their mental image of magic is poor, so that’s how it turned out. However, there’s things like manga here in this world and you can easily imagine it, so you should be able to learn the ones you like.」\r\n\r\nWas it something similar to a stereotype? If that’s the case, why not try creating magic using Magic Manipulation.  \r\n\r\n「Then, Magic Manipulation, please.」\r\n\r\n「Roger!! Anything else?」\r\n\r\nSomething else, huh…. Ahh, there were monsters.\r\n\r\n「Is it possible to tame monsters?」\r\n\r\n「Tame? There are various methods. For example, raising them from when they are young, contractual magic in the case where they have high intelligence, and lastly, binding them to you using subordination magic.」\r\n\r\nI see, then won’t everything work itself out if I could use magic.\r\n\r\n「However, if you’re going to be a monster tamer, it’s best to be careful? Tamers are rare.」\r\n\r\nIs that so? There should be quite a few of them in the stories though.\r\n\r\n「Think about it, there wouldn’t be anyone who would purposely keep a partner who could kill them, right?」\r\n\r\nMuu, that’s fair….\r\n\r\n「That’s why, if you don’t take care when taming monsters, others might think that you’re strange.」\r\n\r\n「I understand, I’ll be careful.」\r\n\r\n「For now, this is what I have, huh.」\r\n\r\nLet’s see, the skills I’ve received were『Different World Language』,『Item Box』,『Appraisal』,『Magic Manipulation』, four of them. They’re not exactly cheats, but they’re luxuries for everyday life.  \r\n\r\n「Nn? If they had the Appraisal skill, wouldn’t it be bad if ‘Different World Language’ was seen?」\r\n\r\n「Oh no, I forgot. I will also give you ‘Concealment’. Since it would be strange that a baby would have this many skills. Hide your skills.」\r\n\r\n \r\n\r\n「Well then, you will now reincarnate to another world.」\r\n\r\n \r\n\r\n「I understand.」\r\n\r\n「You would be found at the orphanage as a baby, so in the beginning, it might be hard, but endure it.」\r\n\r\n「There’s nothing in particular that I need to do?」\r\n\r\n「Un, enjoy your life in another world.」\r\n\r\n「Ahh, I will.」\r\n\r\n「Well then, take care!!」\r\n\r\nAnd so, I was enveloped in a white light and reincarnated in a different world.', 'Andou Masaki ', ' Adventure, Fantasy, Shounen ,Slice of Life ', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068556126254, 'Breakthrough with the Forbidden Master', , '“Compared to our time, the current generation just aren’t as reliable” they said, “Still, isn’t he the son of the Hero?” How annoying. It’s been over ten years since the battle between mankind and the demons ended. The children of the heroes who saved the world are all grown up. One of them, Earth, was a talented man, and everyone expected him to succeed his father as a warrior and defend his country, but Earth was always wary of his father’s title. One day, Earth is shocked to find his father’s sword, which was used to overthrow the Demon King, sealed in his family’s mansion. Because trapped within was the ghost of the Great Demon King who was unable to pass on and continued to roam the world. For some reason, only he could see the spirit of the Demon King, and the Demon King possessed him through the sword. Every day, forced to coexist with the spirit of the Demon King, they live a strange shared life, when the Demon King whispers to Earth on a whim. “I have a grudge against your father. If you want to get back at your father and the world, I’ll train you. I’m free.”. Earth receives special personal guidance from the Demon King just to get back at his parents and the world. Then, in the coming days. The hero’s parents, the heroes of the past, the first love, the princess childhood friend, the geniuses of the era, and the world will tremble. ', 'Chapter 1 – The Wall of Genius\r\nThe Imperial Warrior Academy.\r\n\r\nThree years had already passed since I entered the academy, and the results for end-of year written exam were posted.\r\n\r\nMy name is easy to spot.\r\n\r\n– 1st place: Phianse Depaltia, 1 2nd place: Earth Lagann\r\n\r\nYes, it’s the second from the front. So it’s easy to find.\r\n\r\nFor the past three years, my grades have always fallen within the top 10, so it’s no surprise to me.\r\n\r\nHowever, I have never been in first place.\r\n\r\nAnd, it wasn’t just the written tests but in practical exams as well.\r\n\r\n“Oooooooooooh”\r\n\r\n“Naive… I see through everything you do, Earth.”\r\n\r\nMy abilities are better than that of most people. However, it’s not as big a margin as anyone’s.\r\n\r\n“Thunder Spell 【Kilo Thunder!】”\r\n\r\n“The power of the spell is much better than last week. You seem to have put a lot of effort in a short period of time, but… it’s within my expectations.”\r\n\r\n“What the?!”\r\n\r\nI realized that there was a real genius in my vicinity who far surpassed me.\r\n\r\nA genius I can’t beat, even if I studied enough to break my pen or swung my weapon around till I’m out of breath.\r\n\r\n“See, you’re about to lose your footing.”\r\n\r\n“Whoa, whoa, damn, whoa, who aarrrgh”\r\n\r\n“With this… it’s my win.\r\n\r\nToday, I faced her head on, but ended up down on the ground.\r\n\r\n“Mock battle over. Winner, Phianse!”\r\n\r\nThen, as I lay on my back on the ground, I look up to the sky again right as the cheers started.\r\n\r\n“Oooooh, it’s great. An overwhelming victory for Princess Phianse!”\r\n\r\n“Three years and still undefeated… will the streak stand until graduation?”\r\n\r\n“Lady Phianse… so lovely.”\r\n\r\n“Beautiful and Intelligent as well… truly she is a child prodigy in whose body flows the blood of His Majesty, Emperor Solja, who was said to be the strongest spearman of the Seven Heroes.\r\n\r\n“Yeah. Earth is not weak, but he hasn’t beaten Phianse once.”\r\n\r\nOutdoor on the exercise field! I sighed to the sound of my classmates in the open air.\r\n\r\nIn the end, I’m only hearing the same comments as usual.\r\n\r\n“Are you alright, Earth?”\r\n\r\n“NNngh?!”\r\n\r\n“Your magic power and sword skills have improved in such a short time. I recognize the effort. But you have yet to master it as a 【Magic Sword】 art.”\r\n\r\nAnd, it sounded like something said by the winner looking down on the loser, even though it is usually taken as praise for a worthy opponent after a good match.\r\n\r\n“As you are now, won’t you be a disappointment to your father, the hero. Earth?”\r\n\r\n“I, I lack, the dignity, princess…”\r\n\r\nA woman with beautiful long golden hair that has a slight roll. With dignified expression and eyes, and pure white hands and feet that seem to have never touched dirt.\r\n\r\nShe has a tall and slender figure. Yet so curvaceous you could feel her motherhood.\r\n\r\nShe is dressed in white short-sleeves and half-pants like everyone else, but her divine aura and presence make her feel different.\r\n\r\n“Hey, at the academy we’re all equal. We are even childhood friends. Call me Phianse. No honorifics, it’s a nuisance!”\r\n\r\n”Ha, yeah….”\r\n\r\nAnd thus the scolding commences. However, even if she says to treat her normally, it is impossible. Because, this person is the princess of this country.\r\n\r\n“It’s shameful. I never thought you’d be unable to win even once. With this, won’t the next champion in the [Graduation Commemorative Match] be me.”\r\n\r\n“Ha ha ha, I guess ”\r\n\r\n“Is that funny? When you graduate, you will be a fine warrior, serve the Royal Palace, and will be a key figure in the protection the Imperial Capital beside your father. It would be a pitiful thing that you are weaker than me, the princess.”\r\n\r\nHow many times have I heard this sermon?\r\n\r\nIf the other party wasn’t a princess, I would scream, [SHUT THE F!@# UP WOMAN]\r\n\r\nIf she wasn’t a childhood friend, I might have hit her.\r\n\r\n“As the son of the hero who saved the world, isn’t it embarrassing?”\r\n\r\nIn addition to me, this school has children of nobles and other offspring of the heroes who defeated the Great Demon King.\r\n\r\nHowever, none could beat Princess Phianse, either in academic or in combat.\r\n\r\nYet I’m the only one she preaches to every time. It’s quite annoying.\r\n\r\nAnd it’s not just the sermons that get to me.\r\n\r\n“But… the princess is a really impressive, but…… Earth is pretty strong, too.”\r\n\r\n“Yes, he’s a little withdrawn, but looks a bit wild and cool.”\r\n\r\n“His household is wealthy, too.”\r\n\r\nHere they come! The girls in my class are blushing and praising me.\r\n\r\nThis makes me happy and embarrassed.\r\n\r\nI can’t beat the Princess, but I’m second place in my grade, so I’m an honor student.\r\n\r\nMoreover, because my family is good, the girls usually don’t care.\r\n\r\nHowever…\r\n\r\n“…… Hey, you there!”\r\n\r\nOh, I’m done! The princess approaches the girls who were in the spectator seat by fast walking, and the face is put out with a jerk.\r\n\r\n“There seems to be a little misunderstanding. Certainly, he is talented, his face may not be bad, and he comes from a wealthy family. But, he also has a twisted side too. His character is considerably demonic, and tends to be disobedient at times. Also, more than anything, when I was a child, he rudely peeked at my underwear, and he still hides smutty books in his room. The other day, I heard from his maid that he had hidden a double-bottomed drawer and even set up a magic trap to hide them. No, that isn’t good for the boys of his age, but he’s hiding something obscene. His appearance itself isn’t bad, but the eyes are pretty bad, no, I don’t think it’s wild and masculine, it’s just bad. His family is also wealthy, and his parents are two respectable heroes. However, his upbringing is too lenient, and he was spoiled growing up. You don’t want that, do you? No, but it’s not that he’s not working hard. He studies and trains very hard just so he can beat me. While he seems to not care about losing, I have witnessed his figure working hard in shadows without anyone noticing, still, th-that is, yes. He has no delicacy towards girls. Yes, that’s why you should definitely stop aiming for him.” 2\r\n\r\nShe blew all that abuse towards me at the girls endlessly. How is it even possible to speak so fast?\r\n\r\nAnd the girls who heard it smiled.\r\n\r\n“Ufufufu, oh we understand, princess”\r\n\r\n“Among us… No, I don’t think any girl in the Imperial city is aiming to be Earth’s girlfriend.”\r\n\r\n“Right-♪”\r\n\r\nDamn, you’re making a fool of me?\r\n\r\nYes, if I think about it normally, there’s no way I can be that popular.\r\n\r\nHowever, in the last three years I have never been able to get a girlfriend. So, of course, I’ve never… I don’t have any experience with women!\r\n\r\nIt’s all because of that damn princess who keeps tarnishing my image to the girls! Maybe she hates me!\r\n\r\nHmm, but it doesn’t matter. For me… generally, there’s someone I’ve already set my mind on!\r\n\r\n', 'Shikuramen ', ' Action ,Adventure,Comedy , Fantasy,  School Life,', 0, 0);
INSERT INTO `data_buku` (`id_book`, `judulbuku`, `image`, `deskripsi`, `isibuku`, `pengarang`, `genre`, `rating`, `count_rating`) VALUES
(846068650327020, 'Kamen Rider Zi-o', , 'Setelah semua pertempuran berakhir, Woz mencoba menuliskan sejarah yang benar di Kalender Kedatangan Shin Ohma -nya ... dan serangkaian insiden aneh mulai terjadi. Bersama Sougo, Geiz, dan Tsukuyomi, ia memulai perjalanan petualangannya untuk mengungkap konspirasi di balik insiden tersebut. Namun, teman-temannya mulai menghilang di berbagai waktu! Dan musuh tak terduga sekarang menyerang - satu demi satu! ', 'Pada akhirnya, waktu itu tidak ada artinya. \r\n\r\n \r\n\r\nItulah pemikiran yang terlintas di kepalaku pada hari musim panas tahun 2019. Sudah beberapa hari sejak tuanku, Sougo Tokiwa, membuat keputusan berani itu. \r\n\r\nUntuk seseorang seperti saya yang ada di luar konsep waktu, itu sepenuhnya cukup bagi saya untuk melihat peristiwa itu sebagai \"beberapa hari yang lalu\". Namun, hal yang sama tidak dapat dikatakan untuk tuanku dan orang-orang di sekitarnya. \r\n\r\nPada hari itu, Sougo Tokiwa menciptakan masa depan baru. \r\n\r\nAkibatnya, tidak hanya semua pertempuran yang dia lalui menghilang dari sejarah, tetapi juga waktu yang dia habiskan bersama teman-temannya selama tahun yang penuh peristiwa itu.  \r\n\r\nKeputusan tuanku. \r\n\r\nDia memilih \"penciptaan\". \r\n\r\nTetapi pada saat yang sama, orang bisa melihatnya sebagai \"kehancuran\" juga. \r\n\r\nPenciptaan dan kehancuran. Dua sisi dari koin yang sama.  \r\n\r\nTetapi beberapa hari kemudian, Sougo Tokiwa, Geiz Myokoin, Tsukuyomi, dan semua orang kembali ke akhir musim panas tahun 2018. Setelah melihat tuanku dan teman-temannya melangkah ke dunia baru itu, saya dipenuhi dengan rasa pencapaian. \r\n\r\nDan pada saat yang sama, saya merasakan sedikit kesepian. \r\n\r\nApakah karena saya bukan bagian dari lingkaran mereka? \r\n\r\nApa karena aku tidak ada dalam ingatan mereka? \r\n\r\nMungkin ada beberapa di luar sana yang merasa seperti itu. \r\n\r\nTapi sayangnya, saya tidak diberkahi dengan sentimentalisme seperti itu. \r\n\r\nAmbil contoh kejadian sebelumnya. \r\n\r\nSaat itu aku bertarung melawan diriku yang lain—yang disebut oleh tuanku sebagai \"Woz Putih\"—dengan kelangsungan hidup masa depan satu sama lain yang dipertaruhkan. Ketika saya menyadari bahwa saya berada pada posisi yang kurang menguntungkan, saya merasakan kegembiraan yang menggetarkan saat menerima kemungkinan kepergian saya dari kehidupan. \r\n\r\nDan jika Anda melihat lebih jauh ke masa lalu, atau mungkin masa depan, Anda bisa mengatakan… \r\n\r\nSaya telah menipu “rekan-rekan” saya dan menyebabkan kematian banyak pejuang perlawanan yang berperang melawan penguasa dunia saat ini, Ohma Zi-O. Rata-rata orang mungkin mengatakan bahwa saya hanyalah iblis berdarah dingin dan tidak berperasaan, tetapi bagi saya, itu semua tidak ada artinya. \r\n\r\nJadi mengapa? \r\n\r\nSaya menggunakan orang, mengkhianati mereka, memanipulasi mereka. Saya selalu memiliki kepekaan yang kurang yang membuat saya bertindak menuju tujuan yang lebih besar tanpa pernah mempertanyakan kejahatan atau kebenaran di balik perbuatan yang dilakukan dalam proses tersebut. Kesepian adalah sesuatu yang hanya mungkin ada dalam diri seseorang yang mampu memiliki emosi yang begitu rumit dan sensitif. Mungkinkah aku mengalami perasaan itu, meski hanya sesaat? \r\n\r\nAku merenungkan pikiran itu. Untuk satu malam, saya merenungkannya. \r\n\r\nMeskipun saya masih belum mencapai kesimpulan, saya telah sampai pada satu kemungkinan.  \r\n\r\n \r\n\r\n2018, akhir musim panas. \r\n\r\nHari Sougo Tokiwa, siswa sekolah menengah biasa, dipandu ke jalan menjadi Kamen Rider Zi-O, ancaman yang menjulang ke masa depan. Mari kita sebut hari ini sebagai \"hari asal\", untuk saat ini. \r\n\r\n \r\n\r\nDan kemudian ada hari yang sama, tetapi berbeda. \r\n\r\nHari yang tercipta ketika Sougo Tokiwa rela mengorbankan mimpinya untuk “menjadi raja” dan memberi dunia kesempatan untuk memulai kembali. Mari kita sebut hari ini sebagai \"hari permulaan\". \r\n\r\n \r\n\r\nKarena ada di kedua hari ini, yang memiliki tanggal kalender yang sama namun memiliki arti yang sangat berbeda, aku, dengan kata lain, Woz, pasti memiliki sesuatu yang berubah di dalam diriku. \r\n\r\nDan aku ingin tahu apa itu. \r\n\r\nAku menyelami pikiran sekali lagi. Kali ini saya memikirkannya sedikit lebih lama dari satu malam. \r\n\r\nPeriode satu tahun yang tidak lagi ada di dalam tuanku atau orang-orang di sekitarnya, hanya berada di dalam ingatanku. Apakah saya perlu sekali lagi melihat kembali ke masa itu? \r\n\r\nApa sebenarnya Ohma Zi-O itu? \r\n\r\nDan apa itu Kamen Rider Zi-O? \r\n\r\nMungkin aku perlu melihat kembali sejarah yang terukir bersama tuanku dan rekan-rekannya, Geiz Myokoin dan Tsukuyomi. Setelah jatuh ke dalam keadaan pikiran itu, saya mengulurkan tangan ke Kalender Advent Ohma Sejati. \r\n\r\nKeadaan tertentu telah mendorong saya untuk membuang Kalender Adven Ohma yang telah saya simpan sejak “hari asal” tahun 2018 lalu. \r\n\r\nLebih jauh lagi, saya telah memperhatikan bahwa buku itu mengandung sedikit perbedaan dibandingkan dengan sejarah sebenarnya yang dilalui Sougo Tokiwa. Saya kemudian mengoreksi kesalahan itu dan membuat Kalender Advent Ohma Sejati yang direvisi, dan memutuskan untuk merujuk isinya sebagai \"sejarah resmi\". \r\n\r\nSaya membuka True Ohma Advent Calendar ke halaman prolog untuk pertama kalinya sejak saya merevisinya. \r\n\r\n \r\n\r\nIni tidak aktif. \r\n\r\n \r\n\r\nMeski samar, aku mengenalinya sebagai suara seseorang. \r\n\r\nKedengarannya mengancam, seperti jeritan burung pemangsa yang terdengar dari kejauhan di hutan berkabut, dan tidak jelas, seolah-olah ada semacam suara digital yang meredamnya. \r\n\r\n\"…Siapa disana?\" \r\n\r\nSaya mencoba menanggapi suara itu, tetapi tidak ada jawaban. \r\n\r\nSaya memanggil suara itu beberapa kali lagi, tetapi saya tidak menerima jawaban. Aku bahkan tidak tahu apakah suaraku mencapai mereka. \r\n\r\nSaya memutuskan untuk mengesampingkan masalah suara itu untuk saat ini, dan sekali lagi membuka halaman Kalender Advent Ohma Sejati. \r\n\r\n\"Apa ini…?\"\r\n\r\nKenangan yang direkam dengan rumit itu, mulai dari prolog, episode pertama yang terdiri dari rata-rata siswa SMA Sougo Tokiwa yang memperoleh kekuatan Kamen Rider Zi-O, hingga pertempuran menentukan melawan Swartz di episode ke empat puluh sembilan… \r\n\r\nHalaman terakhirnya sedang dalam proses menghilang. \r\n\r\nTiba-tiba, suara itu sekali lagi memanggilku. \r\n\r\n \r\n\r\nKembali ke hari awal, maka Anda akan tahu. \r\n\r\n \r\n\r\nKali ini aku mendengarnya dengan pasti. \r\n\r\nMeskipun saya masih tidak bisa membedakan pemiliknya. \r\n\r\nNamun, saya tidak bisa tidak bereaksi terhadap kata-katanya yang khas. \r\n\r\nApa itu \"hari permulaan\"? \r\n\r\nJika menggunakan definisi saya, maka itu akan menjadi hari yang baru dibuat di musim panas 2018 yang raja iblis tulis ulang ke dalam sejarah. \r\n\r\n“Apakah ini pertanda sesuatu…? Atau lebih tepatnya, apakah itu sudah terjadi…?” \r\n\r\nHuruf-huruf dalam Kalender Ohma Advent Sejati menghilang dengan sangat lambat satu demi satu, tetapi mereka juga tampak menghilang dengan kecepatan yang stabil. \r\n\r\n\"Apakah seseorang ... mengganggu sejarah ...?\" \r\n\r\n \r\n\r\nPergantian peristiwa itulah yang memicu saya untuk menyelidiki misteri di balik gangguan ruang waktu ini. \r\n\r\nSaya memutuskan untuk melanjutkan dan memecahkan teka-teki aneh ini. \r\n\r\n \r\n\r\nSama seperti bagaimana sebuah sungai kecil yang terpisah dari peradaban jauh di pegunungan suatu hari nanti bisa tumbuh menjadi sungai besar di hilir tanpa ada yang mengetahuinya, pada saat itu, saya gagal meramalkan kesimpulan untuk \"masa depan\" dengan cara apa pun.\r\n\r\n \r\n\r\nTanpa mengetahui bahwa langkah acuh tak acuh yang saya buat akan menjadi pemicu untuk sesuatu yang besar, saya menuju ke \"hari permulaan\" 2018 yang ditulis ulang oleh raja iblis masa lalu.\r\n\r\n \r\n\r\nIni adalah memorandum yang saya, Woz, Penjaga Sejarah, tinggalkan demi pengakuan saya sendiri dalam perjalanan saya menuju kompilasi sejarah yang baru terjadi.', 'Kento Shimoyama ', ' Action ,Adventure,Tokusatsu , Fantasy', 0, 0);

